import React, { View, Component } from 'react';
import './App.css';

function Circle(props){

    return(
      <div className="Circle">
        <span class = "dotM">
          <div className="Label">
            {props.label}
          </div>
        </span>


      </div>
    );

}

class Menu extends Component{
  render(){

    return (
      <div className="CircleBar">
        <Circle label="Home"/>
        <Circle label="Computer Science"/>
        <Circle label="Language"/>
        <Circle label="Photos + Design"/>
        <Circle label="Resume"/>
      </div>
    );

  }

}
export default Menu;
